/**
 * @dev API
 * @param context object containing the response and request object
 * @param bind init function for database wrapper methods
 */
export const paymasterHandler = async (context: any, bind: ABind) => {
  // Implement your function handler logic for API here
  let { request, response } = context;

  // request contains query object. To access user query params use
  let { paymaster, page } = request.query;
  paymaster = paymaster.toString();

  const limit = 100;
  const skip = (page - 1) * limit;

  const IPaymaster: API = bind(Paymaster);
  const IUserOp: API = bind(UserOperation);

  let $paymaster: IPaymaster = await IPaymaster.findOne({
    id: paymaster.toLowerCase(),
  });

  response = {
    paymasterDetails: { paymaster: $paymaster, userOps: [] },
  };

  response.paymasterDetails.userOps.push(
    ...(await IUserOp.find(
      { id: { $in: $paymaster.ops } },
      {},
      {
        skip: skip,
        limit: limit,
      },
    )),
  );

  return response;
};
